import DeleteIcon from '@mui/icons-material/Delete';
import  Button  from '@mui/material/Button';

const DeleteBtn = (props) => {
    return (
        <Button 
                startIcon={<DeleteIcon />}
                variant='outlined'
                color='error'
                onClick={() => props.onDelete(props.id)}
            >
                Delete
            </Button>
    );
};

export default DeleteBtn;
